/*
https://leetcode.com/problems/task-scheduler/
https://leetcode.com/explore/featured/card/july-leetcoding-challenge/547/week-4-july-22nd-july-28th/3404/
You are given a char array representing tasks CPU need to do. It contains capital letters A to Z where each letter represents a different task. Tasks could be done without the original order of the array. Each task is done in one unit of time. For each unit of time, the CPU could complete either one task or just be idle.

However, there is a non-negative integer n that represents the cooldown period between two same tasks (the same letter in the array), that is that there must be at least n units of time between any two same tasks.

You need to return the least number of units of times that the CPU will take to finish all the given tasks.



Example 1:

Input: tasks = ["A","A","A","B","B","B"], n = 2
Output: 8
Explanation:
A -> B -> idle -> A -> B -> idle -> A -> B
There is at least 2 units of time between any two same tasks.
Example 2:

Input: tasks = ["A","A","A","B","B","B"], n = 0
Output: 6
Explanation: On this case any permutation of size 6 would work since n = 0.
["A","A","A","B","B","B"]
["A","B","A","B","A","B"]
["B","B","B","A","A","A"]
...
And so on.
Example 3:

Input: tasks = ["A","A","A","A","A","A","B","C","D","E","F","G"], n = 2
Output: 16
Explanation:
One possible solution is
A -> B -> C -> A -> D -> E -> A -> F -> G -> A -> idle -> idle -> A -> idle -> idle -> A


Constraints:

The number of tasks is in the range [1, 10000].
The integer n is in the range [0, 100].
*/

namespace mySolution {
	//Runtime: 848 ms, faster than 5.11% of C++ online submissions for Task Scheduler.
	//Memory Usage : 58.9 MB, less than 5.17% of C++ online submissions for Task Scheduler.
	class Solution {
	public:

		//unordered_map<char, int> countTasks(const vector<char>& tasks) {
			//unordered_map<char, int> result;
		vector<int> countTasks(const vector<char>& tasks) {
			vector<int> result(26);
			for (const auto t : tasks)
				//result[t] ++;
				result[t - 'A'] ++;
			return result;
		}

		/*priority_queue<pair<char, int>> buildQueue(const vector<int>& tasksCounts) {
			priority_queue<pair<char, int>> queue;
			const auto n = tasksCounts.size();
			for (int i = 0; i < n; ++i) {
				if (tasksCounts[i]) {
					queue.emplace('A' + i, tasksCounts[i]);
				}
			}
			return queue;
		}*/

		struct TaskAndCount {
			int name;
			int count;

			TaskAndCount(int n, int c) : name(n), count(c) {}

			bool operator< (const TaskAndCount& other) const {
				return tie(count, name) > tie(other.count, other.name);
			}

			char NameChar() const {
				return 'A' + name;
			}

			string NameString() const {
				return string() + NameChar();
			}
		};

		set<TaskAndCount> buildQueue(const vector<int>& tasksCounts) {
			set<TaskAndCount> result;
			for (int i = 0; i < tasksCounts.size(); ++i)
				if (tasksCounts[i])
					result.emplace(i, tasksCounts[i]);
			return result;
		}

		int leastInterval(vector<char>& tasks, int n) {
			auto tq = buildQueue(countTasks(tasks));
			vector<int> last(26, -n - 1);
			int nTasks = tasks.size();
			int t = 0;
			while (nTasks > 0) {
				auto it = begin(tq);
				while (it != end(tq) && last[it->name] + n >= t)
					++it;
				if (it != end(tq)) {
					auto task = *it;
					tq.erase(it);
					last[task.name] = t;
					if (--task.count)
						tq.insert(task);
					--nTasks;
					//cout << task.NameString() << " ";
				}
				//else cout << "idle ";

				++t;
			}
			cout << endl;
			return t;
		}
	};
}

//Runtime: 164 ms, faster than 60.34% of C++ online submissions for Task Scheduler.
//Memory Usage : 34.4 MB, less than 87.09% of C++ online submissions for Task Scheduler.
class Solution {
public:

	vector<int> countTasks(const vector<char>& tasks) {
		vector<int> result(26);
		for (const auto t : tasks)
			//result[t] ++;
			result[t - 'A'] ++;
		return result;
	}

	int leastInterval(vector<char>& tasks, int n) {
		auto counts = countTasks(tasks);
		sort(begin(counts), end(counts));
		int len = 1;
		int maxCnt = counts[25];
		for (int i = 24; i >= 0; --i) {
			if (counts[i] == maxCnt)
				++len;
		}
		int space = (n + 1) * (maxCnt - 1) + len;
		return space < tasks.size() ? tasks.size() : space;
	}
};

